import React from "react";
import Banner from "../../components/Banner/Banner";
import Categories from "../../components/Categories/Categories";
import NewProduct from "../../components/NewProduct/NewProduct";

import Slide from "../../components/slide/Slide";
import Slogan from ".././layout/Slogan/Slogan";
import Navigation from "../layout/Navigation/Navigation";

import "./Home.scss";
const Home = () => {
  return (
    <div>
      <div className="container background-slogan">
        <Slogan />
      </div>
      <div className="container">
        <Navigation />
      </div>
      <div>
        <Slide />
      </div>
      <div>
        <Banner />
      </div>
      <div className="section">
        <div className="section__newitems">
          <NewProduct />
        </div>
      </div>
      <div className="widgets">
        <div className="widgets__divider">
          <span className="widgets__divider--separator"></span>
        </div>
      </div>

      <div className="section">
        <div className="section__category">
          <Categories />
        </div>
      </div>

      <div className="widgets">
        <div className="widgets__divider">
          <span className="widgets__divider--separator"></span>
        </div>
      </div>

    
    </div>
  );
};

export default Home;
